import React from 'react';
import { Flex, Text, Heading, Image, Box } from '@chakra-ui/react';

const GameModel = () => {
  return (
    <div>
      <Box
        backgroundImage={`${process.env.PUBLIC_URL}/fetaturebg.jpg`}
        id="features"
        className="jumptarget"
      >
        <div>
          h2
        </div>
      </Box>
    </div>
  );
};

export default GameModel;
